import React from 'react';

import './styles.css';

import logoImg from '../../assets/logo.png';

export default function Register() {
    return (
        <div className="register-container">
            <div className="content">
                <section>
                    <img src={logoImg} alt="Be The Hero" />

                </section>

                <form action=""></form>
            </div>    
        </div>
    );
}
